class RateLimiter:
    def __init__(self, rate):
        self._semaphore = asyncio.Semaphore(rate)
        self._interval = 1.0 / rate

    async def __aenter__(self):
        await self._semaphore.acquire()
        self._start_time = time.time()

    async def __aexit__(self, exc_type, exc_val, exc_tb):
        elapsed = time.time() - self._start_time
        if elapsed < self._interval:
            await asyncio.sleep(self._interval - elapsed)
        self._semaphore.release()


async def fetch_url(url, headers):
    async with aiohttp.ClientSession() as session:
        async with session.get(url, headers=headers) as response:
            return await response.text()


async def scrape_restaurant_menus(restaurant_link, schema_menu, user_agent):
    try:
        headers = {'User-Agent': user_agent}
        html_content = await fetch_url(restaurant_link, headers)
        tree = html.fromstring(html_content)
        h5_elements = tree.xpath('//h5[@class="title-container"]/text()')
        span_elements = tree.xpath('//span[@class="price-container zprice"]/text()')

        print(f"Number of h5 elements for {restaurant_link}: {len(h5_elements)}")
        print(f"Number of span elements for {restaurant_link}: {len(span_elements)}")

        elements = ' '.join(h5_elements + span_elements)

        documents = [Document(page_content=elements, metadata={"source": restaurant_link})]

        splitter = RecursiveCharacterTextSplitter.from_tiktoken_encoder(
            chunk_size=10000, chunk_overlap=0
        )
        splits = splitter.split_documents(documents)
        print(f"Number of splits for {restaurant_link}: {len(splits)}")

        start_extraction = time.time()
        extracted_menus = await asyncio.gather(*[asyncio.to_thread(extract, split.page_content, schema=schema_menu) for split in splits])
        end_extraction = time.time()
        print(f"Time taken for LLM extraction: {end_extraction - start_extraction} seconds")

        return extracted_menus
    except Exception as e:
        print(f"Error scraping {restaurant_link}: {e}")
        return None


async def scrape_city_restaurants(city_link, schema_restaurant, user_agent):
    async with rate_limiter:
        try:
            loader = AsyncChromiumLoader([city_link])
            headers = {'User-Agent': user_agent}
            html = await loader.ascrape_playwright(city_link, headers=headers)
            document = Document(page_content=html, metadata={"source": city_link})

            bs_transformer = BeautifulSoupTransformer()
            docs_transformed = bs_transformer.transform_documents([document], tags_to_extract=["a"])
            splitter = RecursiveCharacterTextSplitter.from_tiktoken_encoder(
                chunk_size=10000, chunk_overlap=0
            )
            splits = splitter.split_documents([docs_transformed[0]])
            extracted_content = [extract(split.page_content, schema=schema_restaurant) for split in splits]

            return extracted_content
        except Exception as e:
            print(f"Error scraping {city_link}: {e}")
            return None


def extract(content: str, schema: dict):
    llm = ChatOpenAI(temperature=0, model="gpt-3.5-turbo-16k-0613")
    return create_extraction_chain(schema=schema, llm=llm).run(content)


def scrape_with_playwright(urls, schema):
    loader = AsyncChromiumLoader(urls)
    html = loader.load()
    bs_transformer = BeautifulSoupTransformer()
    docs_transformed = bs_transformer.transform_documents(html, tags_to_extract=["a"])
    splitter = RecursiveCharacterTextSplitter.from_tiktoken_encoder(
        chunk_size=10000, chunk_overlap=0)
    splits = splitter.split_documents(docs_transformed)
    extracted_content = [extract(split.page_content, schema=schema) for split in splits]
    return extracted_content


